import React from "react";

const About = () => {
  return (
    <div>
      <div className="portfolio">Get in Touch</div>
      <div className="uk-grid">
        <div
          class="uk-child-width-1-2@s uk-child-width-1-3@m"
          uk-grid="masonry: true"
        >
          <div>
            <div class="uk-card uk-card-default uk-flex uk-flex-center uk-flex-middle uk-card-body" id="contactText">
              elizaregas@gmail.com
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
